import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the sort/filter controls to appear (using label text as anchor)
    await page.waitForSelector('label[for="sortSelect"]', { timeout: 10000 });

    // Find the List View button using its icon (fa-list) and button role
    // Use XPath to find the button with a child <i> containing 'fa-list'
    const listViewBtn = await page.waitForSelector(
      '//button[contains(@class,"view-btn") and .//i[contains(@class,"fa-list")]]',
      { timeout: 5000 }
    );

    // Check if the List View button is already active
    const isActive = await listViewBtn.evaluate(btn => btn.classList.contains('active'));
    if (!isActive) {
      // Click the List View button
      await listViewBtn.click();
      // Wait for the products-list container to appear (list view)
      await page.waitForSelector('.products-list', { timeout: 5000 });
      // Wait for at least one product-card-list to be visible
      await page.waitForSelector('.product-card-list', { timeout: 5000 });
    }

    // Take screenshot after switching to List View
    const listViewShot = path.join(screenshotsDir, 'step_2_list_view.png');
    await page.screenshot({ path: listViewShot });
    screenshots.push(listViewShot);

    // Extract some data to verify list view mode
    // Count number of product-card-list elements
    const productListCount = await page.$$eval('.product-card-list', els => els.length);
    // Confirm the container class
    const containerClass = await page.$eval('.products-list', el => el.className);

    return {
      success: true,
      action: "Switched to List View Mode using the List View toggle button",
      extractedData: {
        productListCount,
        containerClass
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
